// import {searchEmployees} from './util/API';
import {Card, CardGroup, CardDeck,Container} from 'react-bootstrap';
function EmployeeList(props){

    return(
<div className="employee">
    <Container>
<CardDeck>
        {props.results.map((employee)=>(
            <div>

        <Card>
        <Card.Img  style={{width:'100%',height:'100%'}}variant="top" src={employee.picture.large} alt={employee.name.first.toLowerCase()}/>
        <Card.Body>
        <Card.Title>{employee.name.first.toLowerCase()} {employee.name.last}</Card.Title>
        <Card.Text>
        Employee ID:{ employee.id.value}
        </Card.Text>
        <Card.Text>
        email:{employee.email}
        </Card.Text>
        </Card.Body>
        </Card>    
        </div>
                ))}
        </CardDeck>
        </Container>
        </div>
    )
}

export default EmployeeList;
